// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./interfaces/ITokenManagement.sol";
import "./AutomaticOwnershipManagement.sol";

/**
 * @author tuan.dq.
 * @title Allow automatic management of administrative rights.
 */
contract TokenManagement is
  Initializable,
  ITokenManagement,
  AutomaticOwnershipManagement
{
  /**
   * Storage
   */

  IERC20 public ERC20TOKEN;

  uint256 public transferCount;

  mapping(uint256 => TransferData) transfers;

  mapping(uint256 => mapping(address => bool)) public transferVotes;

  /// @custom:oz-upgrades-unsafe-allow constructor
  constructor() {
    _disableInitializers();
  }

  modifier transferAccepted(uint256 id) {
    address sender = _msgSender();
    require(transferVotes[id][sender], "TokenManagement Contract: Accepted!");
    _;
  }

  modifier transferRejected(uint256 id) {
    address sender = _msgSender();
    require(!transferVotes[id][sender], "TokenManagement Contract: Rejected!");
    _;
  }

  modifier transferEnoughVotes(uint256 id) {
    require(
      _getTransferVoteCount(id) >= _getRequired(),
      "TokenManagement Contract: Not enough votes!"
    );
    _;
  }

  modifier notTransfer(uint256 id) {
    require(!transfers[id].used, "TokenManagement Contract: transfered!");
    _;
  }

  function initialize(IERC20 ERC20TOKEN_, address[] memory initialOwners_)
    public
    initializer
  {
    __AutomaticOwnershipManagement_init(initialOwners_);
    ERC20TOKEN = ERC20TOKEN_;
    transferCount = 0;
  }

  /**
   * Public functions
   */
  function requestNewTransfer(address to, uint256 amount)
    public
    override
    onlyOwner
  {
    address sender = _msgSender();
    TransferData memory data = TransferData(
      transferCount,
      block.timestamp,
      sender,
      to,
      amount,
      false
    );
    transfers[transferCount] = data;
    emit NewTransfer(sender, transferCount);
    transferCount++;
  }

  function acceptTransfer(uint256 id)
    public
    override
    onlyOwner
    transferRejected(id)
  {
    address sender = _msgSender();
    transferVotes[id][sender] = true;
    emit AcceptTransfer(sender, id);
  }

  function rejectTransfer(uint256 id)
    public
    override
    onlyOwner
    transferAccepted(id)
  {
    address sender = _msgSender();
    transferVotes[id][sender] = false;
    emit RejectTransfer(sender, id);
  }

  function transfer(uint256 id)
    public
    override
    onlyOwner
    transferEnoughVotes(id)
    notTransfer(id)
  {
    TransferData storage transaction = transfers[id];
    transaction.used = true;
    ERC20TOKEN.transfer(transaction.to, transaction.amount);
    emit Transfer(_msgSender(), id);
  }

  function forceTransfer(address to, uint256 amount) public override onlyOwner {
    address sender = _msgSender();
    TransferData memory data = TransferData(
      transferCount,
      block.timestamp,
      sender,
      to,
      amount,
      true
    );
    transfers[transferCount] = data;
    ERC20TOKEN.transfer(to, amount);
    emit NewTransfer(sender, transferCount);
    emit Transfer(_msgSender(), data.id);
    transferCount++;
  }

  /**
   * View functions
   */

  function getAccountVote(uint256 id, address account)
    public
    view
    override
    returns (bool)
  {
    return transferVotes[id][account];
  }

  function getTransferVoteCount(uint256 id)
    public
    view
    override
    returns (uint256)
  {
    return _getTransferVoteCount(id);
  }

  function getPagingTransferData(uint256 offset, uint256 length)
    public
    view
    override
    returns (TransferData[] memory)
  {
    return _getPagingData(offset, length);
  }

  function getAllTransferData()
    public
    view
    override
    returns (TransferData[] memory)
  {
    return _getPagingData(1, transferCount);
  }

  /**
   * Private functions
   */
  function _getTransferVoteCount(uint256 _id)
    public
    view
    returns (uint256 count)
  {
    for (uint256 index = 0; index < owners?.length; index++) {
      address owner = owners[index];
      bool vote = transferVotes[_id][owner];
      if (vote && isOwner[owner] == Status.ACTIVE) {
        count++;
      }
    }
  }

  function _getPagingData(uint256 _offset, uint256 _length)
    private
    view
    returns (TransferData[] memory results)
  {
    require(
      _offset > 0 && _offset <= transferCount,
      "TokenManagement Contract: Invalid _offset!"
    );
    if (_offset + _length - 1 > transferCount) {
      _length = transferCount - _offset + 1;
    }

    results = new TransferData[](_length);
    for (uint256 i = 0; i < _length; i++) {
      results[i] = _getTransferData(_offset + i);
    }
  }

  function _getTransferData(uint256 _id)
    private
    view
    returns (TransferData memory data)
  {
    data = transfers[_id];
  }
}
